//Services.js - Module
import React from 'react';

//Create About Component 
function Services(props) {

    return (<React.Fragment>

        <h1 className='text-center text-primary'>SERVICES COMPONENT</h1>

        <p className="para">A good home provides protection. Children are less at risk of violence and sexual abuse. They are less likely to be forced into child labour, married off at a young age or forcibly recruited by armed groups. A home ensures that displaced people have better access to humanitarian aid.
        </p>

    </React.Fragment>)
}

export default Services;
